float nx3, ny3, nz3;
void norm_neural(float x, float y, float z)
{
    float h[16];
    for(int i = 0; i < 16; i++)
    {
        const int j = i*4;
        h[i] = tanhf((nv0[j] * x) + (nv0[j+1] * y) + (nv0[j+2] * z) + nv0[j+3]);
    }
    float o[3] = {0};
    for(int i = 0; i < 3; i++)
    {
        o[i] = 0.f;
        const int j = i*17;
        for(int k = 0; k < 16; k++)
            o[i] += (nv1[j+k] * h[k]);
        o[i] += nv1[j+16];
    }

    nx3 = o[0];
    ny3 = o[1];
    nz3 = o[2];
}

