float nx4, ny4, nz4;
void norm_neural_256(float x, float y, float z)
{
    float h[256];
    for(int i = 0; i < 256; i++)
    {
        const int j = i*4;
        h[i] = tanhf((n1v0[j] * x) + (n1v0[j+1] * y) + (n1v0[j+2] * z) + n1v0[j+3]);
    }
    float o[3] = {0};
    for(int i = 0; i < 3; i++)
    {
        o[i] = 0.f;
        const int j = i*257;
        for(int k = 0; k < 256; k++)
            o[i] += (n1v1[j+k] * h[k]);
        o[i] += n1v1[j+256];
    }

    nx4 = o[0];
    ny4 = o[1];
    nz4 = o[2];
}

// tanh_sgd_6_32_384_3333333_6_a0.95
float nx5, ny5, nz5;
void norm_neural_6x32(float x, float y, float z)
{
    float h0[32];
    for(int i = 0; i < 32; i++)
    {
        const int j = i*4;
        h0[i] = tanhf((neural_unitvector_layer0[j] * x) + (neural_unitvector_layer0[j+1] * y) + (neural_unitvector_layer0[j+2] * z) + neural_unitvector_layer0[j+3]);
    }

    float h1[32];
    for(int i = 0; i < 32; i++)
    {
        h1[i] = 0.f;
        const int j = i*33;
        for(int k = 0; k < 32; k++)
            h1[i] += (neural_unitvector_layer1[j+k] * h0[k]);
        h1[i] += neural_unitvector_layer1[j+32];
        h1[i] = tanhf(h1[i]);
    }

    float h2[32];
    for(int i = 0; i < 32; i++)
    {
        h2[i] = 0.f;
        const int j = i*33;
        for(int k = 0; k < 32; k++)
            h2[i] += (neural_unitvector_layer2[j+k] * h1[k]);
        h2[i] += neural_unitvector_layer2[j+32];
        h2[i] = tanhf(h1[i]);
    }

    float h3[32];
    for(int i = 0; i < 32; i++)
    {
        h3[i] = 0.f;
        const int j = i*33;
        for(int k = 0; k < 32; k++)
            h3[i] += (neural_unitvector_layer3[j+k] * h2[k]);
        h3[i] += neural_unitvector_layer3[j+32];
        h3[i] = tanhf(h3[i]);
    }

    float h4[32];
    for(int i = 0; i < 32; i++)
    {
        h4[i] = 0.f;
        const int j = i*33;
        for(int k = 0; k < 32; k++)
            h4[i] += (neural_unitvector_layer4[j+k] * h3[k]);
        h4[i] += neural_unitvector_layer4[j+32];
        h4[i] = tanhf(h4[i]);
    }

    float h5[32];
    for(int i = 0; i < 32; i++)
    {
        h5[i] = 0.f;
        const int j = i*33;
        for(int k = 0; k < 32; k++)
            h5[i] += (neural_unitvector_layer5[j+k] * h4[k]);
        h5[i] += neural_unitvector_layer5[j+32];
        h5[i] = tanhf(h5[i]);
    }

    float h6[32];
    for(int i = 0; i < 32; i++)
    {
        h6[i] = 0.f;
        const int j = i*33;
        for(int k = 0; k < 32; k++)
            h6[i] += (neural_unitvector_layer6[j+k] * h5[k]);
        h6[i] += neural_unitvector_layer6[j+32];
        h6[i] = tanhf(h6[i]);
    }

    float o[3] = {0};
    for(int i = 0; i < 3; i++)
    {
        o[i] = 0.f;
        const int j = i*33;
        for(int k = 0; k < 32; k++)
            o[i] += (neural_unitvector_layer7[j+k] * h6[k]);
        o[i] += neural_unitvector_layer7[j+32];
    }

    nx5 = o[0];
    ny5 = o[1];
    nz5 = o[2];
}

float dist(float x1, float y1, float z1, float x2, float y2, float z2)
{
    const float xm = (x1 - x2);
    const float ym = (y1 - y2);
    const float zm = (z1 - z2);
    return sqrtf(xm*xm + ym*ym + zm*zm);
}

